import React from "react";

export const Grid = () => {
  return (
    <>
	  <table>
	    <tbody>
	      <tr>
	        <td>Ali</td>
	        <td>2021-11-05</td>
	        <td>2021-11-14</td>
	      </tr>
	    </tbody>
	  </table>
    </>
  );
};
